import React from 'react';
import { Text } from '../../pages/Local/styles';
import { XYPlot, LineSeries } from 'react-vis';

function Statistics() {
    const data = [
        {x: 0, y: 8},
        {x: 1, y: 5},
        {x: 2, y: 4},
        {x: 3, y: 9},
        {x: 4, y: 1},
        {x: 5, y: 7},
        {x: 6, y: 6},
        {x: 7, y: 3},
        {x: 8, y: 2},
        {x: 9, y: 0}
    ];

    return (
        <>
        <Text>Estat√≠sticas</Text>

        <XYPlot width={300} height={300}>
            <LineSeries data={data} />
        </XYPlot>
        </>
    );
}

export default Statistics;
